import React, { Suspense } from "react";
import Loadable from "react-loadable";

import "./App.css";
import Price from "../Componets/Price";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Spinner from "react-bootstrap/Spinner";

import ChatbotComponent from "../Componets/Chatbot";

import { Provider } from "react-redux";
import { store } from "../redux/store";

import { useDispatch } from "react-redux";
import { Chatbot } from "react-chatbot-kit";

import config from "../Config/";
import MessageParser from "../MessageParser";
import ActionProvider from "../ActionProvider";

const dynamicImport = (importingComponent) =>
  Loadable({
    loader: importingComponent,
    loading: Spinner,
  });

const ListHistory = dynamicImport(() => import("../Componets/ListHistory"));



const App = () => {
  const dispatch = useDispatch();
  const chatbotConfig = config(dispatch);

  return (
    <Provider store={store}>
      <div>
        <Chatbot
          config={chatbotConfig}
          messageParser={new MessageParser(new ActionProvider(dispatch))}
          actionProvider={new ActionProvider(dispatch)}
        />
      </div>
    </Provider>
  );
};

{
  /* <Container>
<Row>
  <Col xs={12} md={8}>
    <Suspense fallback={<div>Loading...</div>}>
      <Row>
        <Price />
        <ListHistory />
      </Row>
    </Suspense>
  </Col>

    <Col xs={6} md={4}>
      <ChatbotComponent />
    </Col>
</Row>
</Container> */
}

export default App;
